q= filter q by {{row(Current_Period_1.selection, [0], ["min", "max"]).asDateRange("date('Date_Year', 'Date_Month', 'Date_Day')")}};
q = group q by 'Product_Name';
q = foreach q generate 'Product_Name' as 'Product',round(sum(q.'Quantity')) as 'Average_Product_Quantity',dense_rank() over([..] partition by all order by coalesce(sum(q.'Quantity'),0) desc) as 'Rank_Quantity';
q_A = filter q by 'Rank_Quantity' == 1;
q_B= filter q by 'Product'=="{{cell(Overall_Product_KPIs.selection, 0, "Product_Name").asString()}}";
q = cogroup q_B by all full, q_A by all;
q = foreach q generate sum(q_A.'Average_Product_Quantity')as 'Max_Average_Product_Quantity', sum(q_B.'Average_Product_Quantity') as 'Product_Quantity',(sum(q_B.'Average_Product_Quantity') - {{cell(Avg_Product_Gauge_Qu_1.result, 0, "Avg_Product_Quantity").asObject()}})/sum(q_B.'Average_Product_Quantity') as 'Diff_Product_Quantity';
q = limit q 2000;

